// import Card from './components/Card.jsx';
import Cards from './components/Cards/Cards.jsx';
import SearchBar from './components/Search/SearchBar.jsx';
import characters from './data.js';

//seccion estilos
import style from './App.module.css'

function App() {
   return (
    <div className = {style.principalContainer}>

      {/* Seccion de Nav */}
      <nav className = {style.containerNav}>
        <SearchBar onSearch={(characterID) => window.alert(characterID)} className = {style.containerSearch}/>
        <ul className = {style.unorderList}>
          <li><a href='facebook.com'>About Us</a></li>
          <li><a href='yputube.com'>Contact Galaxy</a></li>
          <li><a>Rick & Morty</a></li>
          <li><a>Llamanos</a></li>
        </ul>
      </nav>

      {/* Seccion de cards */}
      <section>
        <Cards characters={characters} />
      </section>
    </div>
  );
}

export default App;
